// ApiBc49.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css'

const ApiNumbers = ({ endpoint }) => {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Fetch data from the specified endpoint
        axios.get(endpoint)
            .then(response => {
                setData(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, [endpoint]);

    return (
        <div className="card">
            <span className='App-link'>{endpoint}</span>
            <table responsive="true" className="table mb-4" size="sm" hover="true" striped="true">
                <thead className="table-danger text-center">
                    <tr>
                        <th className="text-light bg-info">No</th>
                        {/* <th className="text-light bg-info">LottoTypeId</th> 
                        <th className="text-light bg-info">Distance</th>
                        <th className="text-light bg-info">IsHit</th>
                        <th className="text-light bg-info">NumberOfDrawsWhenHit</th>
                        <th className="text-light bg-info">IsBonusNumber</th>
                        <th className="text-light bg-info">TotalHits</th>  */}                     
                    </tr>
                </thead>
                <tbody >
                    {data.map(item => (
                        <tr key={item.Value}>
                            <td className="text-warning bg-primary">{item.Value}, {item.Distance}, {item.IsHit === true ? 1 : 0}, {item.NumberOfDrawsWhenHit}, {item.IsBonusNumber === true ? 1 : 0}, {item.TotalHits}</td>
                            {/* <td>{item.LottoTypeId}</td>
                            <td>{item.Distance}</td>
                            <td>{item.IsHit === true ? 1 : 0}</td>
                            <td>{item.NumberOfDrawsWhenHit}</td>
                            <td>{item.IsBonusNumber === true ? 1 : 0}</td>
                            <td>{item.TotalHits}</td>   
                             */}                      
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}

export default ApiNumbers
